typedef struct Player player;
typedef struct Enemy Enemy;
typedef struct Missile Missile;

// Player struct
// variables:
//        int  x_pos: x-coordinate
//				int	 y_pos: y-coordinate
//				int  dir: angle of movement	(0 deg is y=0, ccw)
//				int  lives: # of lives
//				int  score: current score
//				bool hit: false = not hit, true = hit
struct Player{
	int x_pos;
	int y_pos;
	double x_real;
	double y_real;
	double dir;
	int lives;
	int score;
	bool hit;
};

// Enemy struct
// variables:
//				int type: 0-4 for each type of enemy
//        int  x_pos: x-coordinate
//				int	 y_pos: y-coordinate
//				int  dir: angle of movement	(0 deg is y=0, ccw)
//				int  width: width of enemy img
//				int  height: height of enemy img
//				bool hit: false = not hit, true = hit
struct Enemy{
	int type;
	int x_pos;
	int y_pos;
	int width;
	int height;
	bool hit;
};

struct Missile{
	int x_pos;
	int y_pos;
	double x_real;
	double y_real;
	double dir;
	bool hit;
};

