Enemy enemies[70];
int num_enemies = 0;
int enemy_freq = 1;
int freq_ct = 0;

Missile missiles[500];
int num_missiles;
int missile_delay = 0;

int main(void){
//****** Initializations and stuff here **********
  TExaS_Init();  // set system clock to 80 MHz
  Output_Init(); 
  ST7735_FillScreen(0x0000);   // set screen to black
  Delay100ms(5);		// delay .5 sec at 80 MHz
  PortF_Init(); 
  ADC_InitXYmove(); 
	ADC_InitXYshoot(); 
	SysTick_Init(2000000);	//40 Hz
	srand(ADC1_SSFIFO2_R&0xFFF);

	ST7735_DrawBitmap(0, 160, bms, 128, 160);
	while(!(GPIO_PORTF_DATA_R&0x10)){}
	DAC_Init();
	Timer0A_Init(&TimerTask);
	ST7735_FillScreen(0x0000); 
	player p1;
	Player_Init(&p1);
  while(1){
		if (ADCStatus==1)
		{
			if(p1.lives ==0)
				Game_Over(p1);
			ST7735_SetCursor(0,0);
			ST7735_OutString("Score:");
			LCD_OutDec(p1.score);
			ST7735_OutString("  Lives:");
			LCD_OutDec(p1.lives);
			if((freq_ct%70) == 0){
				int k = 0;
				while(k < enemy_freq){
					Enemy e;
					Enemy_Spawn(&e, p1);
					k++;
				}
			}
			ADCStatus = 0;
			if(ADCXm > 2400 || ADCYm < 1700 || ADCYm > 2400 || ADCXm < 1700)
				Player_Move(&p1);
			if(freq_ct%2 == 0)
				Enemy_Move(enemies, p1);
			Player_Hit(&p1);
			if(p1.hit){
				num_enemies = 0;
				ST7735_FillScreen(0x0000); 
				Player_Update(&p1);
			}
			if(ADCXs > 2400 || ADCYs < 1700 || ADCYs > 2400 || ADCXs < 1700)
				if(freq_ct%9 == 0)
					Missile_Fire(missiles, p1);
			Missiles_Move(missiles);
			freq_ct++;
			p1.score++;
			if(freq_ct%700 == 0)
				enemy_freq++;
			
			ST7735_FillRect(p1.x_pos, p1.y_pos - 16, 20, 16, 0x0000); 
			ST7735_DrawBitmap(p1.x_pos, p1.y_pos, Player, 20, 16);
			
		}
	}
}

// Initializes player in the middle of the screen facing north
void Player_Init(player *playa){
	playa->x_pos = 54; // Initialize to middle of screen
	playa->y_pos = 88;
	playa->x_real = 54;
	playa->y_real = 88;
	playa->dir = 90; // Facing north (i.e. 90 deg)
	playa->lives = 3; // starts with 3 lives
	playa->score = 0; // score is initially 0
	playa->hit = false; // initially player is not hit
	ST7735_DrawBitmap(playa->x_pos, playa->y_pos, Player, 20, 16);
}

void Player_Update(player *playa){
	playa->x_pos = 54; // Initialize to middle of screen
	playa->y_pos = 88;
	playa->x_real = 54;
	playa->y_real = 88;
	playa->dir = 90; // Facing north (i.e. 90 deg)
	playa->hit = false;
	ST7735_DrawBitmap(playa->x_pos, playa->y_pos, Player, 20, 16);
}

// Spawns new enemy in a random location that is not already occupied
void Enemy_Spawn(Enemy *enemy, player p1){
	enemy->type = rand()%100;
		if(enemy->type < 20){
			enemy->type = 0;
			enemy->width = 10;
			enemy->height = 9;
		}
		else if (enemy->type < 40){
			enemy->type = 1;
			enemy->width = 10;
			enemy->height = 10;
		}
		else if (enemy->type < 60){
			enemy->type = 2;
			enemy->width = 10;
			enemy->height = 9;
		}
		else if (enemy->type < 80){
			enemy->type = 3;
			enemy->width = 10;
			enemy->height = 10;
		}
		else{
			enemy->type = 4;
			enemy->width = 10;
			enemy->height = 9;
		}
	enemy->x_pos = rand()%(128 - enemy->width);
	enemy->y_pos = 10 + enemy->height + rand()%(150-enemy->height);
	if(num_enemies == 0)
		while((enemy->x_pos < (p1.x_pos + 20))
		&& ((enemy->x_pos + enemy->width) > p1.x_pos)
		&& (enemy->y_pos > (p1.y_pos - 16))
		&& ((enemy->y_pos - enemy->height) < p1.y_pos)
			)
		{
			enemy->x_pos = rand()%(128 - enemy->width);
			enemy->y_pos = 10 + enemy->height + rand()%(150-enemy->height);
		}
	for(int i = 0; i < num_enemies; i++){
		if((enemy->x_pos < (enemies[i].x_pos + enemies[i].width))
		&& ((enemy->x_pos + enemy->width) > enemies[i].x_pos)
		&& (enemy->y_pos > (enemies[i].y_pos - enemies[i].height))
		&& ((enemy->y_pos - enemy->height) < enemies[i].y_pos)
			)
		{
			enemy->x_pos = rand()%(128 - enemy->width);
			enemy->y_pos = 10 + enemy->height + rand()%(150-enemy->height);
			i = 0;
		}
		if((enemy->x_pos < (p1.x_pos + 20))
		&& ((enemy->x_pos + enemy->width) > p1.x_pos)
		&& (enemy->y_pos > (p1.y_pos - 16))
		&& ((enemy->y_pos - enemy->height) < p1.y_pos)
			)
		{
			enemy->x_pos = rand()%(128 - enemy->width);
			enemy->y_pos = 10 + enemy->height + rand()%(150-enemy->height);
			i = 0;
		}
	}
	enemy->hit = false;
	enemies[num_enemies] = *enemy;
	num_enemies++;
	Draw_Enemy(enemy);
}

// Draws enemy based on type
void Draw_Enemy(Enemy *enemy){
	switch(enemy->type){
		case 0:
			ST7735_DrawBitmap(enemy->x_pos, enemy->y_pos, Pink, enemy->width, enemy->height);
			break;
		case 1:
			ST7735_DrawBitmap(enemy->x_pos, enemy->y_pos, Purple, enemy->width, enemy->height);
			break;
		case 2:
			ST7735_DrawBitmap(enemy->x_pos, enemy->y_pos, Green, enemy->width, enemy->height);
			break;
		case 3:
			ST7735_DrawBitmap(enemy->x_pos, enemy->y_pos, Circle, enemy->width, enemy->height);
			break;
		case 4:
			ST7735_DrawBitmap(enemy->x_pos, enemy->y_pos, Triangle, enemy->width, enemy->height);
			break;
	}
}

void Player_Move(player *playa){
	ST7735_FillRect(playa->x_pos, playa->y_pos - 16, 20, 16, 0x0000); 
	playa->dir = atan2(ConvertY(ADCYm), ConvertX(ADCXm));
	playa->x_real = playa->x_pos + 2*cos(playa->dir);
	playa->y_real = playa->y_pos + 2*sin(playa->dir);
	playa->x_pos = round(playa->x_real);
	playa->y_pos = round(playa->y_real);
	if(playa->x_pos < 0)
		playa->x_pos = 0;
	if((playa->y_pos - 16) <= 10)
		playa->y_pos = 26;
  if((playa->x_pos + 20) > 128)
		playa->x_pos = 108;
	if((playa->y_pos) > 160)
		playa->y_pos = 160;
	ST7735_DrawBitmap(playa->x_pos, playa->y_pos, Player, 20, 16);
}

// Detects if player has hit an enemy
void Player_Hit(player *playa){
	for(int i = 0; i < num_enemies; i++){
		if((playa->x_pos < (enemies[i].x_pos + enemies[i].width))
		&& ((playa->x_pos + 20) > enemies[i].x_pos)
		&& (playa->y_pos > (enemies[i].y_pos - enemies[i].height))
		&& ((playa->y_pos - 16) < enemies[i].y_pos)
			)
		{
			playa->lives--;
			playa->hit = true;
			break;
		}
	}
}

